    { day: "Mon", temperature: 23, description: "üå§Ô∏è Clear", humidity: 65, windSpeed: 10 },
    { day: "Tue", temperature: 25, description: "‚õÖ Partly cloudy", humidity: 60, windSpeed: 12 },
    { day: "Wed", temperature: 22, description: "üå¶Ô∏è Light rain showers", humidity: 70, windSpeed: 8 },
    { day: "Thu", temperature: 24, description: "üå§Ô∏è Clear", humidity: 62, windSpeed: 11 },
    { day: "Fri", temperature: 26, description: "üåû Sunny", humidity: 58, windSpeed: 14 }
  ];

  import React from "react";

function Forecast({ forecastData }) {
  return (
    <div className="forecast-container">
      <h2>4-Day Forecast</h2>
      <div className="forecast-list">
        {forecastData.map((dayForecast, index) => (
          <div className="forecast-item" key={index}>
            <div className="day">{dayForecast.day}</div>
            <div>{dayForecast.description}</div>
            <div>Temperature: {dayForecast.temperature}¬∞C</div>
            <div>Humidity: {dayForecast.humidity}%</div>
            <div>Wind Speed: {dayForecast.windSpeed} km/h</div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Forecast;
